import { LOGIN_TYPE } from '../actions';

const INITIAL_STATE = {
  user: {
    email: '',
  },
  // wallet: {
  //   currencies: [],
  //   expenses: [],
  // },
};

function loginReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
  case LOGIN_TYPE: {
    const { email } = action.value;
    return { email };
  }
  default:
    return state;
  }
}

export default loginReducer;
